import React from "react";

const Todo = () => {
    return (
        <div className="todo">
            <li className="todo-item">HEYYYYY</li>
            <button> 
                <i className="fas fa-check"></i>
            </button>
            <button> 
                <i className="fas fa-trash"></i>
            </button>
        </div>
    );
};
